import React from 'react';
import './CostItem.module.css'

const CostItem = () => {
    return (
        <div className="cost-item">
            <div>Декабрь 2021 12</div>
            <div>
                <h2>Ноутбук</h2>
                <div>1000$</div>
            </div>
        </div>
    );
};

export default CostItem;
